    "parker-river-national-wildlife-refuge-narrative-report-may-june-july-august-1945",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1945. The report begins by summarizing the weather conditions, wildfires, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, mammals, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments. Resource management
    is outlined; topics include grazing and haying. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, and fishing. N-R forms  are attached.",nt"license_title":
